                var dashboard = "#dashboard";
                // class
                var activeLink = "active-link";
                var accountMng = "#account-mng";
                // view poin or main content
                var mainSection = ".main-section";

                //page
                var accountMngPage = "./view/accountManagement.php";
                var dashboardPage = "./view/dashboard.php";
                var accountPage = "./view/account.php";
                var systemPage = "./view/systemManagement.php";
                var chatPage = "./view/chatManagement.php";

                // jquery function
                // dashboard content
                $(mainSection).load(dashboardPage);
                $(dashboard).addClass(activeLink);
                $(dashboard).click(function() {
                    $(mainSection).load(dashboardPage);
                    $(dashboard).addClass(activeLink);
                    $(systemMng).removeClass(activeLink);
                    $(accountMng).removeClass(activeLink);
                    $(account).removeClass(activeLink);
                    $(chatMng).removeClass(activeLink);
                });
                // system management content
                $(systemMng).click(function() {
                    $(mainSection).load(systemPage);
                    $(systemMng).addClass(activeLink);
                    $(dashboard).removeClass(activeLink);
                    $(accountMng).removeClass(activeLink);
                    $(account).removeClass(activeLink);
                    $(chatMng).removeClass(activeLink);
                });
                //account management content
                $(accountMng).click(function() {
                    $(mainSection).load(accountMngPage);
                    $(systemMng).removeClass(activeLink);
                    $(accountMng).addClass(activeLink);
                    $(account).removeClass(activeLink);
                    $(chatMng).removeClass(activeLink);
                    $(dashboard).removeClass(activeLink);
                });
                //chat management content
                $(chatMng).click(function() {
                    $(mainSection).load(chatPage);
                    $(systemMng).removeClass(activeLink);
                    $(accountMng).removeClass(activeLink);
                    $(account).removeClass(activeLink);
                    $(chatMng).addClass(activeLink);
                    $(dashboard).removeClass(activeLink);
                });
                //account management content
                $(account).click(function() {
                    $(mainSection).load(accountPage);
                    $(systemMng).removeClass(activeLink);
                    $(accountMng).removeClass(activeLink);
                    $(account).addClass(activeLink);
                    $(chatMng).removeClass(activeLink);
                    $(dashboard).removeClass(activeLink);
                });
